%s"]'=>'[рендеринг блоку зупинено для шаблону "%s"]','Different layouts containing audio.'=>'Різні макети, що містять аудіо.','Block pattern categoryAudio'=>'Аудіо','Different layouts containing videos.'=>'Різні макети, що містять відео.','Block pattern categoryVideos'=>'Відео','block bindings sourcePost Meta'=>'Мета повідомлення','block bindings sourcePattern Overrides'=>'Перевизначення шаблону','block descriptionDisplay the publish date for an entry such as a post or page.'=>'Відображати дату публікації запису, наприклад, допису або сторінки.','block titleDate'=>'Дата','block titleContent'=>'Зміст','block titleAuthor'=>'Автор','block keywordtoggle'=>'перемикач','block keywordaccordion'=>'акордеон','Export as JSON'=>'Експорт як JSON','Template part updated.'=>'Оновлена частина шаблону.','taxonomy singular namePattern Category'=>'Категорія шаблону','taxonomy general namePattern Categories'=>'Категорії шаблонів','Expected string to start with script tag (without attributes) and end with script tag, with optional whitespace.'=>'Очікуваний рядок починається з тегу script (без атрибутів) і закінчується тегом script, з необов\'язковим пробілом.','%d years'=>'%d років','a year'=>'на рік','%d months'=>'%d місяців','a month'=>'на місяць','%d days'=>'%d днів','a day'=>'в день','%d hours'=>'%d годин','an hour'=>'за годину','%d minutes'=>'%d хвилин','a minute'=>'хвилинку','%d seconds'=>'%d секунд','a second'=>'секундочку','Invalid template parent ID.'=>'Невірний ідентифікатор батька шаблону.','There is no autosave revision for this template.'=>'Для цього шаблону не передбачено автозбереження ревізій.','This block is automatically inserted near any occurrence of the block types used as keys of this map, into a relative position given by the corresponding value.'=>'Цей блок автоматично вставляється біля будь-якого входження типів блоків, що використовуються як ключі цієї мапи, у відносну позицію, задану відповідним значенням.','View Media File'=>'Перегляд медіафайлу'