nu.'=>'Унікальний ідентифікатор для навігаційного меню.','No fallback menu found.'=>'Запасне меню не знайдено.','Sorry, you are not allowed to edit Navigation Menus as this user.'=>'Вибачте, вам не дозволено редагувати меню навігації як цьому користувачеві.','Sorry, you are not allowed to create Navigation Menus as this user.'=>'На жаль, ви не маєте права створювати меню навігації від імені цього користувача.','Cannot find user global styles revisions.'=>'Не вдається знайти ревізії глобальних стилів користувача.','Custom CSS selectors.'=>'Користувацькі селектори CSS.','Where the pattern comes from e.g. core'=>'Звідки береться шаблон, наприклад, ядро','Pattern updated.'=>'Шаблон оновлено.','Pattern scheduled.'=>'Розклад розписаний.','Pattern reverted to draft.'=>'Шаблон повернуто до чернетки.','Pattern published privately.'=>'Шаблон опубліковано в приватному порядку.','Pattern published.'=>'Шаблон опубліковано.','Patterns list navigation'=>'Навігація списком шаблонів','Filter patterns list'=>'Список шаблонів для фільтрації','No patterns found.'=>'Закономірностей не виявлено.','Search Patterns'=>'Шаблони пошуку','All Patterns'=>'Всі візерунки','View Patterns'=>'Переглянути шаблони','View Pattern'=>'Шаблон перегляду','Edit Block Pattern'=>'Редагувати шаблон блоку','New Pattern'=>'Новий візерунок','Add New Pattern'=>'Додати новий шаблон','post type singular namePattern'=>'Візерунок','post type general namePatterns'=>'Візерунки','An image should not be lazy-loaded and marked as high priority at the same time.'=>'Зображення не повинно бути одночасно ліниво завантаженим і позначеним як високопріоритетне.','The Edit Media screen is deprecated as of WordPress 6.3. Please use the Media Library instead.'=>'Екран редагування медіа застарілий, починаючи з WordPress 6.3. Будь ласка, використовуйте замість нього Медіатеку.','Object ID must be an integer, %s given.'=>'Ідентифікатор об\'єкта має бути цілим числом, задано %s.','Cannot supply a strategy `%1$s` for script `%2$s` because it is an alias (it lacks a `src` value).'=>'Неможливо вказати стратегію `%1$s` для скрипта `%2$s`, оскільки це псевдонім (йому не вистачає значення `rc`).','Invalid strategy `%1$s` defined for `%2$s` during script registration.'=>'Невірна стратегія `%1$s`, визначена для `%2$s` під час реєстрації скрипта.','Page trashed.'=>'Сторінку знищено.','Post trashed.'=>'Пошта розбита.','Title of a Navigation menuNavigation'=>'Навігація','Unable to convert Classic Menu to blocks.'=>'Не вдається перетворити класичне меню на блоки.','No Classic Menus found.'=>'Класичних меню не знайдено.','The duotone id "%1$s" is not registered in %2$s settings'=>'Ідентифікатор дуотону "%1$s" не зареєстровано в налаштуваннях %2$s','The menu provided is not a valid menu.'=>'Надане меню не є дійсним.','Expand search field'=>'Розгорнути поле пошуку','Template namePage: 404'=>'Сторінка: 404','Template nameSearch Results'=>'Результати пошуку','Attachment Pages'=>'Вкладені сторінки','Template nameTag Archives'=>'Архіви тегів','Template nameDate Archives'=>'Архіви дат','Template nameCategory Archives'=>'Категорія Архіви','Template nameAuthor Archives'=>'Архіви авторів','Template nameAll Archives'=>'Всі архіви','Template nameSingle Entries'=>'Одиночні записи','Template nameBlog Home'=>'Блог Головна сторінка','template part areaFooter'=>'Нижній колонтитул','template part areaHeader'=>'Заголовок','template part areaGeneral'=>'Генерал','block categoryPatterns'=>'Візерунки','custom image headerHeader'=>'Заголовок','custom backgroundBackground'=>'Передумови','Get Involved'=>'Долучайтеся','Displays when a visitor views a non-existent page, such as a dead link or a mistyped URL.'=>'Відображається, коли відвідувач переглядає неіснуючу сторінку, наприклад, непрацююче посилання або неправильно введену URL-адресу.','Displays your site\'s Privacy Policy page.'=>'Відображає сторінку політики конфіденційності вашого сайту.','Displays when a visitor performs a search on your website.'=>'Відображається, коли відвідувач здійснює пошук на вашому сайті.','Displays when a visitor views the dedicated page that exists for any media attachment.'=>'Відображається, коли відвідувач переглядає спеціальну сторінку, яка існує для будь-якого медіа-вкладення.','Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>'Відображає архів тегів дописів. Цей шаблон слугуватиме запасним варіантом, якщо не вдасться знайти більш специфічний шаблон (наприклад, тег: Піца).','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'Відображає архів постів при відвідуванні певної дати (наприклад, example.com/2023/).','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'Відображає архів користувацьких таксономій. Подібно до категорій і тегів, таксономії мають терміни, які ви використовуєте для класифікації речей. Наприклад: таксономія з назвою "Мистецтво" може мати кілька термінів, наприклад, "Модерн" і "18 століття" Цей шаблон слугуватиме запасним варіантом, якщо не вдасться знайти більш конкретний шаблон (наприклад, Таксономія: Мистецтво).','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'Відображає архів категорій дописів. Цей шаблон слугуватиме запасним варіантом, якщо не вдасться знайти більш специфічний шаблон (наприклад, Категорія: Рецепти).','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'Відображає архів дописів одного автора. Цей шаблон слугуватиме запасним варіантом, якщо не вдасться знайти більш специфічний шаблон (наприклад, Автор: Адміністратор).','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'Відображає будь-який архів, включно з повідомленнями одного автора, категорією, тегом, таксономією, типом повідомлення і датою. Цей шаблон слугуватиме запасним варіантом, якщо не вдасться знайти більш специфічні шаблони (наприклад, Категорія або Тег).','Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>'Відображає статичну сторінку, якщо до неї не застосовано користувацький шаблон або не існує спеціального шаблону.','Displays a single post on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'Відображає окремий допис на вашому веб-сайті, якщо до нього не застосовано спеціальний шаблон або якщо не існує спеціального шаблону.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'Відображає будь-який окремий запис, наприклад, допис або сторінку. Цей шаблон слугуватиме запасним варіантом, якщо не вдасться знайти більш специфічний шаблон (наприклад, "Окремий допис", "Сторінка" або "Вкладення").','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'Відображає домашню сторінку вашого сайту, незалежно від того, чи налаштовано її на відображення останніх публікацій, чи це статична сторінка. Шаблон "Головна сторінка" має пріоритет над усіма шаблонами.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'Відображає останні публікації на головній сторінці сайту або на "Сторінці публікацій", як визначено в налаштуваннях читання. Якщо він існує, шаблон "Головна сторінка" замінює цей шаблон, коли дописи показуються на головній сторінці.','Used as a fallback template for all pages when a more specific template is not defined.'=>'Використовується як запасний шаблон для всіх сторінок, якщо не визначено більш конкретний шаблон.','Block pattern categoryAbout'=>'Про','Block pattern categoryTeam'=>'Команда','Block pattern categoryPosts'=>'Пости','Block pattern categoryBanners'=>'Банери','block descriptionThe author name.'=>'Ім\'я автора.','block titleAuthor Name'=>'Ім\'я автора Ім\'я автора','block keywordpage'=>'сторінка','block descriptionDisplays a page inside a list of all pages.'=>'Відображає сторінку всередині списку всіх сторінок.','block titlePage List Item'=>'Список сторінок Елемент списку','Style Variations'=>'Варіації стилю','Position'=>'Посада','Sticky'=>'Липкий','https://wordpress.org/documentation/article/reset-your-password/'=>'https://wordpress.org/documentation/article/reset-your-password/','https://wordpress.org/documentation/article/site-editor/'=>'https://wordpress.org/documentation/article/site-editor/','Array of column names to be searched.'=>'Масив назв стовпців для пошуку.','The block types which can use this pattern.'=>'Типи блоків, які можуть використовувати цей шаблон.','An array of template types where the pattern fits.'=>'Масив типів шаблонів, яким відповідає шаблон.','The category description, in human readable format.'=>'Опис категорії у зручному для читання форматі.','Download file'=>'Завантажити файл','Please check that the %s PHP extension is installed and enabled.'=>'Переконайтеся, що розширення PHP %s встановлено і ввімкнено.','When using the %1$s constant, make sure to set these globals to an array: %2$s.'=>'При використанні константи %1$s переконайтеся, що ці глобали задано як масив: %2$s.','The query argument must be an array or a 