ist item'=>'Пункт списку','block titleComments'=>'Коментарі','block titleComments Previous Page'=>'Коментарі Попередня сторінка','block titleComments Page Numbers'=>'Номери сторінок коментарів','block titleComments Next Page'=>'Коментарі Наступна сторінка','block titleCategories List'=>'Список категорій','Single item: %s'=>'Одна штука: %s','Default template'=>'Шаблон за замовчуванням','%s comment'=>'%s коментар' . "\0" . '%s коментарі' . "\0" . '%s коментарі','Create a site or only a username:'=>'Створіть сайт або тільки ім\'я користувача:','Site Domain (subdomain only):'=>'Домен сайту (тільки субдомен):','Site Name (subdirectory only):'=>'Назва сайту (тільки для підкаталогу):','There doesn\'t seem to be a %s file. It is needed before the installation can continue.'=>'Здається, файла %s не існує. Він потрібен для продовження встановлення.','The date and time the preferences were updated.'=>'Дата і час оновлення налаштувань.','Whether the theme disables generated layout styles.'=>'Чи вимикає тема згенеровані стилі компонування.','Whether a theme uses block-based template parts.'=>'Чи використовує тема частини шаблону на основі блоків.','$store must be an instance of WP_Style_Engine_CSS_Rules_Store'=>'$store має бути екземпляром WP_Style_Engine_CSS_Rules_Store','Revisions not enabled.'=>'Ревізії не ввімкнено.','The template prefix for the created template. This is used to extract the main template type, e.g. in `taxonomy-books` extracts the `taxonomy`'=>'Префікс шаблону для створеного шаблону. Використовується для вилучення основного типу шаблону, наприклад, у `taxonomy-books` вилучається `taxonomy`','Indicates if a template is custom or part of the template hierarchy'=>'Вказує, чи є шаблон користувацьким або частиною ієрархії шаблонів','The slug of the template to get the fallback for'=>'Шаблон шаблону, щоб отримати резервну копію для','The icon for the post type.'=>'Іконка для типу допису.','If the value is a string, the value will be used as the archive slug. 