your profile</a>. <a href="%3$s">Log out?</a>'=>'Ви увійшли як %1$s. <a href="%2$s">Редагувати свій профіль</a>. <a href="%3$s">Вийти? </a>','%sX-Large'=>'%sX-Large','%sX-Small'=>'%sX-Small','Your %1$s file uses a dynamic value (%2$s) for the path at %3$s. However, the value at %3$s is also a dynamic value (pointing to %4$s) and pointing to another dynamic value is not supported. Please update %3$s to point directly to %4$s.'=>'Ваш файл %1$s використовує динамічне значення (%2$s) для шляху за адресою %3$s. Однак значення за адресою %3$s також є динамічним (вказує на %4$s), і вказівка на інше динамічне значення не підтримується. Будь ласка, змініть значення %3$s, щоб воно вказувало безпосередньо на %4$s.','put your unique phrase here'=>'введіть свою унікальну фразу тут','Cache key must be an integer or a non-empty string, %s given.'=>'Ключ кешу повинен бути цілим чи непорожнім рядком, задано %s.','Cache key must not be an empty string.'=>'Ключ кешу не повинен бути порожнім рядком.','There has been a critical error on this website. Please reach out to your site administrator, and inform them of this error for further assistance.'=>'На цьому сайті сталася критична помилка. Будь ласка, зв\'яжіться з адміністратором вашого сайту і повідомте йому про цю помилку для отримання подальшої допомоги.','When checking for the %s capability, you must always check it against a specific user.'=>'Перевіряючи наявність можливості %s, ви завжди повинні перевіряти її для конкретного користувача.','When checking for the %s capability, you must always check it against a specific term.'=>'Перевіряючи наявність можливості %s, ви завжди повинні порівнювати її з конкретним терміном.','When checking for the %s capability, you must always check it against a specific comment.'=>'Перевіряючи наявність можливості %s, ви завжди повинні перевіряти її з конкретним коментарем.','When checking for the %s capability, you must always check it against a specific page.'=>'Перевіряючи наявність можливості %s, ви завжди повинні перевіряти її на конкретній сторінці.','When checking for the %s capability, you must always check it against a specific post.'=>'Перевіряючи наявність функції %s, ви завжди повинні перевіряти її для конкретного допису.','Your object cache implementation does not support flushing individual groups.'=>'Ваша реалізація кешу об\'єктів не підтримує очищення окремих груп.','Your object cache implementation does not support flushing the in-memory runtime cache.'=>'Ваша реалізація об\'єктного кешу не підтримує очищення кешу у пам\'яті під час виконання.','Deleted author: %s'=>'Видалено автора: %s','Template for %s'=>'Шаблон для %s','Not found: %1$s (%2$s)'=>'Не знайдено: %1$s (%2$s)','Block pattern categoryFooters'=>'Нижній колонтитул','Cron unschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'Помилка незапланованої події Cron для хука: %1$s, Код помилки: %2$s, Повідомлення про помилку: %3$s, Дані: %4$s','Cron reschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'Помилка перенесення події Cron для хука: %1$s, Код помилки: %2$s, Повідомлення про помилку: %3$s, Дані: %4$s','Whether a theme uses block-based templates.'=>'Чи використовує тема шаблони на основі блоків.','The ID of the page that should display the latest posts'=>'Ідентифікатор сторінки, на якій мають відображатися останні повідомлення','The ID of the page that should be displayed on the front page'=>'Ідентифікатор сторінки, яка має відображатися на головній сторінці','What to show on the front page'=>'Що показувати на першій сторінці','File %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'Файл %1$s є <strong>застарілим</strong> починаючи з версії %2$s і не має альтернативи.','File %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'Файл %1$s є <strong>застарілим</strong> починаючи з версії %2$s! Замість нього використовуйте %3$s.','Function %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'Функцію %1$s <strong>застаріло</strong> починаючи з версії %2$s без альтернативи.','Function %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'Функцію %1$s <strong>застаріло</strong> починаючи з версії %2$s! Замість неї використовуйте %3$s.','block descriptionDisplays the link of a post, page, or any other content-type.'=>'Відображає посилання на допис, сторінку або будь-який інший тип контенту.','block titleRead More'=>'Читати далі','block descriptionContains the block elements used to render content when no query results are found.'=>'Містить елементи блоку, що використовуються для відображення вмісту, коли не знайдено результатів запиту.','block titleNo results'=>'Немає результатів','block descriptionDisplay post author details such as name, avatar, and bio.'=>'Відображати дані автора допису, такі як ім\'я, аватарка та біографія.','block descriptionThe author biography.'=>'Біографія автора.','block titleAuthor Biography'=>'Біографія автора','block descriptionCreate a link that always points to the homepage of the site. Usually not necessary if there is already a site title link present in the header.'=>'Створіть посилання, яке завжди вказує на домашню сторінку сайту. Зазвичай це не потрібно, якщо в заголовку вже є посилання на назву сайту.','block titleHome Link'=>'Посилання на головну сторінку','block descriptionGather blocks in a layout container.'=>'Зберіть блоки в контейнер для макетів.','block descriptionDisplays a title with the number of comments.'=>'Відображає заголовок з кількістю коментарів.','block titleComments Title'=>'Коментарі Назва','block descriptionAn advanced block that allows displaying post comments using different visual configurations.'=>'Просунутий блок, який дозволяє відображати коментарі до постів, використовуючи різні візуальні конфігурації.','block descriptionDisplays a paginated navigation to next/previous set of comments, when applicable.'=>'Відображає посторінкову навігацію до наступного/попереднього набору коментарів, коли це можливо.','block titleComments Pagination'=>'Коментарі Пагінація сторінок','block descriptionDisplays the previous comment\'s page link.'=>'Відображає посилання на сторінку попереднього коментаря.','block descriptionDisplays a list of page numbers for comments pagination.'=>'Відображає список номерів сторінок для пагінації коментарів.','block descriptionDisplays the next comment\'s page link.'=>'Відображає посилання на сторінку наступного коментаря.','block descriptionContains the block elements used to display a comment, like the title, date, author, avatar and more.'=>'Містить елементи блоку, що використовуються для відображення коментаря, такі як заголовок, дата, автор, аватар тощо.','block titleComment Template'=>'Шаблон коментаря','block descriptionDisplays a link to reply to a comment.'=>'Відображає посилання для відповіді на коментар.','block titleComment Reply Link'=>'Коментар Коментар Посилання','block descriptionDisplays a link to edit the comment in the WordPress Dashboard. This link is only visible to users with the edit comment capability.'=>'Відображає посилання для редагування коментаря на панелі управління WordPress. Це посилання бачать лише користувачі з можливістю редагування коментарів.','block titleComment Edit Link'=>'Коментар Редагувати посилання','block descriptionDisplays the date on which the comment was posted.'=>'Відображає дату, коли коментар був опублікований.','block descriptionDisplays the contents of a comment.'=>'Відображає вміст коментаря.','block descriptionDisplays the name of the author of the comment.'=>'Відображає ім\'я автора коментаря.','block titleComment Author Name'=>'Коментар Ім\'я автора','block descriptionAdd a user’s avatar.'=>'Додати аватар користувача.','block titleAvatar'=>'Аватар','A WordPress Commenter'=>'Коментатор WordPress','Responses to %s'=>'Відповіді на %s','Response to %s'=>'Реакція на %s','block titleComment Date'=>'Дата коментаря','block titleComment Content'=>'Зміст коментаря','Default Avatar'=>'Аватар за замовчуванням','Alignment optionNone'=>'Ні','There is already a ping from that URL for this post.'=>'Для цього допису вже є пінг з цієї URL-адреси.','The password cannot be a space or all spaces.'=>'Пароль не може містити пробіл або всі пробіли.','Need more help? <a href="%1$s">Read the support article on %2$s</a>.'=>'Потрібна додаткова допомога? <a href="%1$s">Прочитайте статтю підтримки на %2$s</a>.','The database server could be connected to (which means your username and password is okay) but the %s database could not be selected.'=>'До сервера бази даних вдалося підключитися (що означає, що з вашим ім\'ям користувача та паролем все гаразд), але не вдалося вибрати базу даних %s.','Cannot select database'=>'Не вдається вибрати базу даних','That file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'Цей файл не може бути знайдено. Перевірте вашу <a href="%s">медіатеку</a> і переконайтеся, що його не було видалено.','Sorry, the video at the supplied URL cannot be loaded. Please check that the URL is for a supported video file (%s) or stream (e.g. YouTube and Vimeo).'=>'На жаль, відео за вказаною URL-адресою не вдасться завантажити. Будь ласка, перевірте, чи вказана URL-адреса для підтримуваного відеофайлу (%s) або потоку (наприклад, YouTube і Vimeo).','That video cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'Це відео не вдається знайти. Перевірте свою <a href="%s">медіатеку</a> і переконайтеся, що його не було видалено.','That image cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'Це зображення не може бути знайдено. Перевірте вашу <a href="%s">медіатеку</a> і переконайтеся, що його не було видалено.','That audio file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'Цей аудіофайл не може бути знайдений. Перевірте свою <a href="%s">медіатеку</a> і переконайтеся, що його не було видалено.','User URL may not be longer than 100 characters.'=>'URL користувача не може бути довшим за 100 символів.','Unable to pass %s if not using multisite.'=>'Неможливо передати %s, якщо не використовується багатосайтовість.','Webfont font weight must be a properly formatted string or integer.'=>'Вага шрифту Webfont має бути правильно відформатованим рядком або цілим числом.','Each webfont src must be a non-empty string.'=>'Кожен файл src веб-шрифту повинен бути непорожнім рядком.','Webfont src must be a non-empty string or an array of strings.'=>'Webfont src має бути непорожнім рядком або масивом рядків.','Webfont font family must be a non-empty string.'=>'Сімейство шрифтів Webfont має бути непорожнім рядком.','Limit results to those matching a pattern (slug).'=>'Обмежте результати лише тими, що відповідають шаблону (ярлику).','Ancestor blocks.'=>'Блоки предків.','Determines whether the pattern is visible in inserter.'=>'Визначає, чи буде шаблон видимим у вставці.','The pattern keywords.'=>'Ключові слова шаблону.','The pattern category slugs.'=>'Категорія шаблонів - ярлики.','Block types that the pattern is intended to be used with.'=>'Типи блоків, з якими буде використовуватися шаблон.','The pattern viewport width for inserter preview.'=>'Ширина області перегляду для попереднього перегляду вставки.','The pattern detailed description.'=>'Детальний опис викрійки.','The pattern name.'=>'Ім\'я шаблону.','Sorry, you are not allowed to view the registered block patterns.'=>'Вибачте, вам не дозволено переглядати зареєстровані шаблони блоків.','The category label, in human readable format.'=>'Етикетка категорії в зручному для читання форматі.','The category name.'=>'Назва категорії.','Sorry, you are not allowed to view the registered block pattern categories.'=>'Вибачте, вам не дозволено переглядати зареєстровані категорії шаблонів блоків.','Error in deleting the attachment.'=>'Помилка при видаленні вкладення.','<strong>Error:</strong> This is not a valid feed template.'=>'<strong>Помилка:</strong> Це недійсний шаблон стрічки.','unit symbolPB'=>'PB','unit symbolEB'=>'EB','unit symbolZB'=>'ЗБ','unit symbolYB'=>'YB','The description will be displayed in the menu if the active theme supports it.'=>'Опис буде відображено в меню, якщо активна тема підтримує його.','A title on that page cannot be found.'=>'Заголовок на цій сторінці неможливо знайти.','color schemeLight'=>'Світло','color schemeDark'=>'Темнота','<strong>Error:</strong> The themes directory is either empty or does not exist. Please check your installation.'=>'<strong>Помилка:</strong> Теку тем або порожньо, або її не існує. Будь ласка, перевірте ваше встановлення.','File does not exist?'=>'Файл не існує?','Adding an RSS feed to this site’s homepage is not supported, as it could lead to a loop that slows down your site. Try using another block, like the <strong>Latest Posts</strong> block, to list posts from the site.'=>'Додавання RSS-стрічки на головну сторінку цього сайту не підтримується, оскільки це може призвести до зациклення, яке сповільнить роботу сайту. Спробуйте використати інший блок, наприклад, блок <strong>Останні публікації</strong>, щоб перерахувати публікації з сайту.','Responses'=>'Відповіді','Response'=>'Відповідь','Older Comments'=>'Старіші коментарі','Newer Comments'=>'Новіші коментарі','(%s website link, opens in a new tab)'=>'(посилання на сайт %s, відкривається в новій вкладці)','(%s author archive, opens in a new tab)'=>'(%s авторський архів, відкривається в новій вкладці)','%s Avatar'=>'%s Аватар','Could not register file "%s" as a block pattern ("Title" field missing)'=>'Не вдалося зареєструвати файл "%s" як шаблон блоку (відсутнє поле "Title")','Could not register file "%1$s" as a block pattern (invalid slug "%2$s")'=>'Не вдалося зареєструвати файл "%1$s" як шаблон блоку (невірний slug "%2$s")','Could not register file "%s" as a block pattern ("Slug" field missing)'=>'Не вдалося зареєструвати файл "%s" як шаблон блоку (відсутнє поле "Slug")','Block pattern categoryFeatured'=>'Особливості','Use Site Editor'=>'Використовуйте редактор сайту','Hurray! Your theme supports site editing with blocks. <a href="%1$s">Tell me more</a>. %2$s'=>'Ура! Ваша тема підтримує редагування сайту за допомогою блоків. <a href="%1$s">Розповісти мені більше</a>. %2$s','Icon'=>'Ікона','Site icon.'=>'Іконка сайту.','block descriptionDisplay the description of categories, tags and custom taxonomies when viewing an archive.'=>'Відображати опис категорій, тегів і користувацьких таксономій при перегляді архіву.','block titleTerm Description'=>'Термін Опис','block descriptionEdit the different global regions of your site, like the header, footer, sidebar, or create your own.'=>'Редагуйте різні глобальні області вашого сайту, такі як верхній, нижній колонтитул, бічна панель, або створіть власну.','block titleTemplate Part'=>'Шаблонна частина','block descriptionCreate structured content in rows and columns to display information.'=>'Створюйте структурований контент у вигляді рядків і стовпців для відображення інформації.','block descriptionDisplays the name of this site. Update the block, and the changes apply everywhere it’s used. This will also appear in the browser title bar and in search results.'=>'Відображає назву цього сайту. Оновіть блок, і зміни будуть застосовані скрізь, де він використовується. Це також з\'явиться в рядку заголовка браузера і в результатах пошуку.','block style labelPlain'=>'Рівнина','block titlePagination'=>'Пагінація','block titlePrevious Page'=>'Попередня сторінка','block titlePage Numbers'=>'Номери сторінок','block titleNext Page'=>'Наступна сторінка','block descriptionDisplays the next or previous post link that is adjacent to the current post.'=>'Відображає посилання на наступний або попередній допис, який є суміжним з поточним дописом.','block titlePost