WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Привіт!

WordPress має вбудовану функцію, яка виявляє, коли плагін або тема викликає фатальну помилку на вашому сайті, і повідомляє вас про це автоматичним електронним листом.
###ПРИЧИНА###
Спочатку відвідайте ваш сайт (###SITEURL###) і перевірте, чи немає видимих проблем. Потім відвідайте сторінку, на якій виникла помилка (###PAGEURL###), і перевірте наявність видимих проблем.

###SUPPORT###

Якщо ваш сайт не працює і ви не можете отримати нормальний доступ до своєї панелі управління, WordPress тепер має спеціальний "режим відновлення". Це дозволяє вам безпечно увійти в панель управління і продовжити дослідження.

###LINK###

Щоб захистити ваш сайт, це посилання втратить чинність через ###EXPIRES###. Але не хвилюйтеся: вам буде надіслано нове посилання, якщо помилка повториться після закінчення терміну дії.

При зверненні за допомогою у вирішенні цієї проблеми вас можуть попросити надати наступну інформацію:
###DEBUG###

