###SITEURL###','Only UUID V4 is supported at this time.'=>'Наразі підтримується лише UUID V4.','The Press This plugin is required.'=>'Натисніть Цей плагін потрібен.','%s themes'=>'%s тем','Filter themes (%s)'=>'Фільтр тем (%s)','Go to theme sources'=>'Перейти до джерел теми','Search WordPress.org themes'=>'Пошук тем на WordPress.org','Install &amp; Preview'=>'Встановити &amp; Попередній перегляд','Invalid URL.'=>'Неправильна URL-адреса.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'Час додати кілька посилань! Натисніть &#8220;%s&#8221;, щоб почати додавати сторінки, категорії та кастомні посилання в меню. Додавайте стільки, скільки хочете.','Choose image'=>'Виберіть зображення','Choose audio'=>'Виберіть аудіо','Change audio'=>'Змінити звук','Select audio'=>'Виберіть аудіо','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Натисніть "Додати нове зображення", щоб завантажити файл зображення з вашого комп\'ютера. Ваша тема найкраще працює із зображеннями з висотою заголовка %s пікселів; ви зможете обрізати зображення після завантаження, щоб воно ідеально вписувалося.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Натисніть "Додати нове зображення", щоб завантажити файл зображення з вашого комп\'ютера. Ваша тема найкраще працює із зображеннями з шириною заголовка %s пікселів; ви зможете обрізати зображення після завантаження, щоб воно ідеально вписувалося.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Натисніть "Додати нове зображення", щоб завантажити файл зображення з вашого комп\'ютера. Ваша тема найкраще працює із зображеннями з розміром заголовка %s пікселів; ви зможете обрізати зображення після завантаження, щоб воно ідеально вписувалося.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Натисніть "Додати нове зображення", щоб завантажити файл зображення з вашого комп\'ютера. Ваша тема найкраще працює із зображенням, яке відповідає розміру вашого відео; ви зможете обрізати зображення після завантаження, щоб воно ідеально вписувалося.','%1$s-%2$s'=>'%1$s-%2$s','Meridian'=>'Меридіан','Minute'=>'Хвилинку','Hour'=>'Година','Time'=>'Час','Day'=>'День','Month'=>'Місяць','Date'=>'Дата','Usage of user levels is deprecated. Use capabilities instead.'=>'Використання рівнів користувачів застаріло. Натомість використовуйте можливості.','The theme defines itself as its parent theme. Please check the %s header.'=>'Тема визначає себе як батьківську тему. Будь ласка, перевірте заголовок %s.','Name for the Visual editor tabVisual'=>'Візуальний','Create New Menu'=>'Створити нове меню','New Menu'=>'Нове меню','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Якщо у вашій темі є області віджетів, ви також можете додавати меню туди. Відвідайте <a href="%s">Панель віджетів</a> і додайте віджет &#8220;Меню навігації&#8221;, щоб відобразити меню на бічній панелі або в нижньому колонтитулі.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Якщо у вашій темі є кілька меню, надання їм чітких назв допоможе вам керувати ними.','Your theme can display menus in %s location.'=>'Ваша тема може відображати меню у %s розташуванні.' . "\0" . 'Ваша тема може відображати меню у %s місцях.' . "\0" . 'Ваша тема може відображати меню у %s місцях.','Your theme can display menus in one location.'=>'Ваша тема може відображати меню в одному місці.','CSS code'=>'CSS код','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Поле редагування автоматично підсвічує синтаксис коду. Ви можете вимкнути це у своєму <a href="%1$s" %2$s>профілі користувача%3$s</a>, щоб працювати у режимі звичайного тексту.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'Користувачі програм для читання з екрану: у режимі форм може знадобитися натиснути клавішу Esc двічі.','To move away from this area, press the Esc key followed by the Tab key.'=>'Щоб вийти з цієї області, натисніть клавішу Esc, а потім клавішу Tab.','In the editing area, the Tab key enters a tab character.'=>'В області редагування клавіша Tab вводить символ табуляції.','When using a keyboard to navigate:'=>'При використанні клавіатури для навігації:','Add your own CSS code here to customize the appearance and layout of your site.'=>'Додайте тут свій власний код CSS, щоб налаштувати зовнішній вигляд і макет вашого сайту.','Your homepage displays'=>'На вашій домашній сторінці відображається','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Ви можете вибрати, що відображатиметься на головній сторінці вашого сайту. Це можуть бути пости в зворотному хронологічному порядку (класичний блог) або фіксована/статична сторінка. Щоб встановити статичну домашню сторінку, спочатку потрібно створити дві Сторінки. Одна з них стане головною, а на іншій будуть відображатися ваші публікації.','Homepage Settings'=>'Налаштування домашньої сторінки','WordPress.org themes'=>'Теми WordPress.org','Installed themes'=>'Встановлені теми','Publish Settings'=>'Налаштування публікації','Copied'=>'Зрозумів','Preview Link'=>'Посилання для попереднього перегляду','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'Подивіться, як зміни виглядатимуть на вашому веб-сайті в реальному часі, і поділіться попереднім переглядом з людьми, які не мають доступу до Кастомізатора.','Share Preview Link'=>'Поділіться посиланням для попереднього перегляду','Changes trashed successfully.'=>'Зміни успішно знищені.','Changes have already been trashed.'=>'Зміни вже розгромлені.','Unable to trash changes.'=>'Неможливо видалити зміни.','No changes saved yet, so there is nothing to trash.'=>'Жодних змін ще не збережено, тож смітити нема чого.','There was an authentication problem. Please reload and try again.'=>'Виникла проблема з автентифікацією. Будь ласка, перезавантажте і спробуйте ще раз.','Unable to save due to %s invalid setting.'=>'Неможливо зберегти через неправильне значення %s.' . "\0" . 'Не вдалося зберегти через %s невірних налаштувань.' . "\0" . 'Не вдалося зберегти через %s невірних налаштувань.','You must supply a future date to schedule.'=>'Ви повинні вказати майбутню дату для планування.','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'Попередній набір змін вже було опубліковано. Будь ласка, спробуйте зберегти поточний набір змін ще раз.','Edit User'=>'Редагувати користувача','View User'=>'Переглянути користувача','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'Цей віджет може містити код, який може працювати краще у віджеті &#8220↩Кастомний HTML&#8221;. Якщо ви ще не зробили цього, чому б не спробувати цей віджет замість нього?','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'Привіт, схоже, ви щойно вставили HTML-код на вкладку "Візуальний" віджета "Текст". Можливо, ви захочете вставити код на вкладку "Текст" замість цього. Крім того, спробуйте новий віджет &#8220;Кастомний HTML&#8221;!','Did you just paste HTML?'=>'Ви щойно вставили HTML?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'Чи знаєте ви, що тепер є віджет "Кастомний HTML"? Ви можете знайти його, просканувавши список доступних віджетів на цьому екрані. Перевірте його, щоб додати кастомний код на свій сайт!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'Чи знаєте ви, що тепер є віджет &#8220;Кастомний HTML&#8221;? Ви можете знайти його, натиснувши кнопку &#8220;<a class="add-widget" href="#">Додати віджет</a>&#8221; та здійснивши пошук &#8220;HTML&#8221;. Ознайомтеся з ним, щоб додати кастомний код на свій сайт!','New Custom HTML Widget'=>'Новий користувацький HTML-віджет','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'Цей віджет може містити код, який може працювати краще у віджеті &#8220↩Кастомний HTML&#8221;. Як щодо того, щоб спробувати цей віджет замість нього?','Arbitrary text.'=>'Довільний текст.','Some HTML tags are not permitted, including:'=>'Деякі HTML-теги заборонені, зокрема:','Custom HTML'=>'Спеціальний HTML','Arbitrary HTML code.'=>'Довільний HTML-код.','Show tag counts'=>'Показати кількість тегів','%s item'=>'%s елемент' . "\0" . '%s елементів' . "\0" . '%s елементів','label for button in the media widgetAdd Media'=>'Додати медіа','label for button in the video widgetAdd Video'=>'Додати відео','label for button in the image widgetAdd Image'=>'Додати зображення','label for button in the audio widgetAdd Audio'=>'Додати аудіо','(no author)'=>'(без автора)','To change or disable registration go to your <a href="%s">Options page</a>.'=>'Щоб змінити або вимкнути реєстрацію, перейдіть на свою <a href="%s">сторінку налаштувань</a>.','The network currently allows both site and user registrations.'=>'Наразі мережа дозволяє реєструвати як сайти, так і користувачів.','The network currently allows user registrations.'=>'Наразі мережа дозволяє реєстрацію користувачів.','The network currently allows site registrations.'=>'Наразі мережа дозволяє реєструвати сайти.','The network currently disallows registrations.'=>'Наразі мережа забороняє реєстрацію.','Greetings Network Administrator!'=>'Вітаємо адміністратора мережі!','Title for the widget'=>'Назва для віджету','URL to the media file'=>'URL-адреса до медіафайлу','Attachment post ID'=>'Ідентифікатор вкладеного повідомлення','Looks like this is not the correct kind of file. Please link to an appropriate file instead.'=>'Схоже, це неправильний тип файлу. Натомість, будь ласка, вкажіть посилання на відповідний файл.','Media Widget'=>'Медіа-віджет','Media Widget (%d)'=>'Віджет медіа (%d)' . "\0" . 'Віджет медіа (%d)' . "\0" . 'Віджет медіа (%d)','Add to Widget'=>'Додати у віджет','label for button in the media widget; should preferably not be longer than ~13 characters longEdit Media'=>'Редагувати медіа','label for button in the media widget; should preferably not be longer than ~13 characters longReplace Media'=>'Замінити носій','No media selected'=>'Не вибрано жодного носія','A media item.'=>'Стаття в ЗМІ.','URL to the %s video source file'=>'URL-адреса вихідного файлу відео %s','Video Widget'=>'Віджет відео','Video Widget (%d)'=>'Віджет відео (%d)' . "\0" . 'Віджет відео (%d)' . "\0" . 'Віджет відео (%d)','label for button in the video widget; should preferably not be longer than ~13 characters longEdit Video'=>'Редагувати відео','label for button in the video widget; should preferably not be longer than ~13 characters longReplace Video'=>'Замінити відео','label for button in the gallery widget; should not be longer than ~13 characters longAdd Images'=>'Додати зображення','Displays a video from the media library or from YouTube, Vimeo, or another provider.'=>'Відображає відео з медіатеки або з YouTube, Vimeo чи іншого провайдера.','Image Widget'=>'Віджет зображення','Image Widget (%d)'=>'Віджет зображення (%d)' . "\0" . 'Віджет зображення (%d)' . "\0" . 'Віджет зображення (%d)','label for button in the image widget; should preferably not be longer than ~13 characters longEdit Image'=>'Редагувати зображення','label for button in the image widget; should preferably not be longer than ~13 characters longReplace Image'=>'Замінити зображення','label for button in the gallery widget; should not be longer than ~13 characters longEdit Gallery'=>'Редагувати галерею','Displays an image.'=>'Відображає зображення.','Unable to preview media due to an unknown error.'=>'Неможливо переглянути медіа через невідому помилку.','URL to the %s audio source file'=>'URL-адреса до файлу джерела звуку %s','Looks like this is not the correct kind of file. Please link to an audio file instead.'=>'Схоже, це неправильний тип файлу. Будь ласка, додайте посилання на аудіофайл.','Audio Widget'=>'Аудіо-віджет','Audio Widget (%d)'=>'Віджет аудіо (%d)' . "\0" . 'Віджет аудіо (%d)' . "\0" . 'Віджет аудіо (%d)','label for button in the audio widget; should preferably not be longer than ~13 characters longEdit Audio'=>'Редагувати аудіо','label for button in the audio widget; should preferably not be longer than ~13 characters longReplace Audio'=>'Замінити звук','No audio selected'=>'Аудіо не вибрано','Displays an audio player.'=>'Відображає аудіоплеєр.','%1$s must be less than or equal to %2$d'=>'%1$s має бути меншим або рівним %2$d','%1$s must be less than %2$d'=>'%1$s має бути меншим за %2$d','%1$s must be greater than or equal to %2$d'=>'%1$s має бути більшим або рівним %2$d','%1$s must be greater than %2$d'=>'%1$s має бути більшим за %2$d','Limit result set to users with one or more specific slugs.'=>'Обмежити набір результатів для користувачів з одним або кількома конкретними мішенями.','Limit result set to terms with one or more specific slugs.'=>'Обмежте результат набором умов з одним або кількома конкретними слайдами.','The page number requested is larger than the number of pages available.'=>'Запитаний номер сторінки перевищує кількість доступних сторінок.','You need to define an include parameter to order by include.'=>'Вам потрібно визначити параметр include, щоб впорядкувати за допомогою include.','All features, supported by the post type.'=>'Всі функції, що підтримуються типом повідомлення.','The password for the parent post of the comment (if the post is password protected).'=>'Пароль до батьківського допису коментаря (якщо допис захищено паролем).','pageUse as featured image'=>'Використовуйте як головне зображення','postUse as featured image'=>'Використовуйте як головне зображення','pageRemove featured image'=>'Видалити зображення з об\'єктом показу','postRemove featured image'=>'Видалити зображення з об\'єктом показу','pageSet featured image'=>'Встановити зображення на обкладинці','postSet featured image'=>'Встановити зображення на обкладинці','pageFeatured image'=>'Вибране зображення','postFeatured image'=>'Вибране зображення','%1$s is deprecated. The callback from %2$s is used instead.'=>'виклик з %1$s застарілий. Замість нього використовується зворотний виклик з %2$s.','You are about to permanently delete these items from your site.
This action cannot be undone.
 \'Cancel\' to stop, \'OK\' to delete.'=>'Ви збираєтеся назавжди видалити ці елементи зі свого сайту.
Ця дія не може бути скасована.
 натисніть "Скасувати", щоб зупинити, "ОК", щоб видалити.','You are about to permanently delete this item from your site.
This action cannot be undone.
 \'Cancel\' to stop, \'OK\' to delete.'=>'Ви збираєтеся назавжди видалити цей елемент зі свого сайту.
