і блоків. Ви знайдете її скрізь, де ви бачите іконку <InserterIconImage />.','Get to know the block library'=>'Ознайомлення з бібліотекою блоків','Each block comes with its own set of controls for changing things like color, width, and alignment. These will show and hide automatically when you have a block selected.'=>'Кожен блок має власний набір елементів керування для зміни таких параметрів, як колір, ширина та вирівнювання. Ці елементи показуватимуться і ховатимуться автоматично, коли ви виберете блок.','Make each block your own'=>'Зробіть кожен блок своїм','In the WordPress editor, each paragraph, image, or video is presented as a distinct “block” of content.'=>'У редакторі WordPress кожен абзац, зображення або відео представлені як окремий "блок" контенту.','Welcome to the block editor'=>'Ласкаво просимо до редактора блоків','inserter'=>'вставка','A page reload is required for this change. Make sure your content is saved before reloading.'=>'Для цієї зміни потрібно перезавантажити сторінку. Переконайтеся, що ваш вміст збережено перед перезавантаженням.','Fullscreen mode deactivated'=>'Повноекранний режим вимкнено','Fullscreen mode activated'=>'Повноекранний режим активовано','Custom fields'=>'Користувацькі поля','Fullscreen mode'=>'Повноекранний режим','Exit fullscreen'=>'Вийти на весь екран','Toggle fullscreen mode.'=>'Увімкнути повноекранний режим.','Could not set that as the thumbnail image. Try a different attachment.'=>'Не вдалося встановити його як мініатюру. Спробуйте інше вкладення.','Editor tips'=>'Поради редактора','Disable tips'=>'Вимкнути підказки','Got it'=>'Зрозумів','See next tip'=>'Дивіться наступну підказку','Close block inserter'=>'Закрийте вставку блоку','https://wordpress.org/documentation/article/block-based-widgets-editor/'=>'https://wordpress.org/documentation/article/block-based-widgets-editor/','Your theme provides %s “block” area for you to add and edit content. Try adding a search bar, social icons, or other types of blocks here and 