te the below iFrame.'=>'Попередній перегляд HTML ще не повністю доступний. Будь ласка, переключіть програму для читання з екрану у віртуальний режим, щоб переглянути наведені нижче iFrame.','Custom HTML Preview'=>'Попередній перегляд у форматі HTML','Open images in new tab'=>'Відкрийте зображення в новій вкладці','Randomize order'=>'Випадковий порядок','Crop images to fit'=>'Обріжте зображення за розміром','Add gallery caption'=>'Додати підпис галереї','Error/failure message for form submissions.'=>'Повідомлення про помилку/невдачу при відправленні форми.','Form Submission Error'=>'Помилка заповнення форми','Your form has been submitted successfully.'=>'Ваша анкета успішно відправлена.','Success message for form submissions.'=>'Повідомлення про успішне відправлення форми.','Form Submission Success'=>'Успішне заповнення форми','Submission error notification'=>'Повідомлення про помилку надсилання','Submission success notification'=>'Повідомлення про успішне відправлення','Enter the message you wish displayed for form submission error/success, and select the type of the message (success/error) from the block\'s options.'=>'Введіть повідомлення, яке ви хочете, щоб відображалося у разі помилки/успіху відправки форми, і виберіть тип повідомлення (успіх/помилка) з опцій блоку.','A numeric input.'=>'Числове введення.','Number Input'=>'Введення числа','Used for phone numbers.'=>'Використовується для телефонних номерів.','Telephone Input'=>'Телефонний вхід','Used for URLs.'=>'Використовується для URL-адрес.','URL Input'=>'Введення URL-адреси','Used for email addresses.'=>'Використовується для адрес електронної пошти.','Email Input'=>'Вхід по електронній пошті','A simple checkbox input.'=>'Простий чекбокс.','Checkbox Input'=>'Вхід з чекбоксами','A textarea input to allow entering multiple lines of text.'=>'Текстова область для введення декількох рядків тексту.','Textarea Input'=>'Введення текстової області','A generic text input.'=>'Типовий текстовий ввід.','Text Input'=>'Введ