sions. Additional options for the "custom" mode can be found in the "Advanced" section.'=>'Виберіть метод, який буде використовуватися для відправки форм. Додаткові опції для режиму "кастомний" можна знайти в розділі "Додатково".','- Custom -'=>'- Користувальницькі -','Send email'=>'Надіслати електронну пошту','Submissions method'=>'Спосіб подання заявок','There was an error submitting your form.'=>'Виникла помилка при відправці вашої форми.','Your form has been submitted successfully'=>'Ваша форма була успішно відправлена','Focal point'=>'Координаційний центр','Caption text'=>'Текст підпису','Query block: Force page reload enabled'=>'Блок запитів: Увімкнено примусове перезавантаження сторінки','Currently, avoiding full page reloads is not possible when a Content block is present inside the Query block.'=>'Наразі уникнути повного перезавантаження сторінки неможливо, якщо всередині блоку запиту присутній блок вмісту.','If you still want to prevent full page reloads, remove that block, then disable "Force page reload" again in the Query Block settings.'=>'Якщо ви все ще хочете запобігти повному перезавантаженню сторінок, видаліть цей блок, а потім знову вимкніть "Примусове перезавантаження сторінок" у налаштуваннях блоку запитів.','Force page reload'=>'Примусове перезавантаження сторінки','Force page reload can\'t be disabled because there are non-compatible blocks inside the Query block.'=>'Примусове перезавантаження сторінки не може бути вимкнено, оскільки в блоці Query є несумісні блоки.','Browsing between pages won\'t require a full page reload, unless non-compatible blocks are detected.'=>'Перехід між сторінками не вимагатиме повного перезавантаження сторінки, якщо тільки не буде виявлено несумісних блоків.','Footnotes are not supported here. Add this block to post or page content.'=>'Виноски тут не підтримуються. Додайте цей блок до вмісту допису або сторінки.','%s name'=>'%s ім\'я','%s: Name'=>'%s: Ім\'я','Specify how many links can appear before and after the 