st by pressing <kbd>backspace</kbd> at the beginning of a line.'=>'Переносите список, натискаючи <kbd>пробіл</kbd> на початку рядка.','Indent a list by pressing <kbd>space</kbd> at the beginning of a line.'=>'Відступ у списку можна зробити, натиснувши <kbd>пробіл</kbd> на початку рядка.','Open Colors Selector'=>'Відкрити селектор кольорів','Change matrix alignment'=>'Змінити вирівнювання матриці','Spacing'=>'Інтервал','Padding'=>'Набивка','Line height'=>'Висота рядка','Block %1$s is at the beginning of the content and can’t be moved left'=>'Блок %1$s знаходиться на початку вмісту і не може бути переміщений вліво','Block %1$s is at the beginning of the content and can’t be moved up'=>'Блок %1$s знаходиться на початку вмісту і не може бути переміщений вгору','Block %1$s is at the end of the content and can’t be moved left'=>'Блок %1$s знаходиться в кінці вмісту і не може бути переміщений вліво','Block %1$s is at the end of the content and can’t be moved down'=>'Блок %1$s знаходиться в кінці вмісту і не може бути переміщений вниз','Move %1$s block from position %2$d right to position %3$d'=>'Перемістити блок %1$s з позиції %2$d праворуч у позицію %3$d','Move %1$s block from position %2$d left to position %3$d'=>'Перемістити блок %1$s з позиції %2$d ліворуч у позицію %3$d','Toggle between using the same value for all screen sizes or using a unique value per screen size.'=>'Перемикайтеся між використанням однакового значення для всіх розмірів екрана або використанням унікального значення для кожного розміру екрана.','Use the same %s on all screen sizes.'=>'Використовуйте однакові %s для всіх розмірів екрану.','Large screens'=>'Великі екрани','Medium screens'=>'Середні сита','Small screens'=>'Малі екрани','Text labelling a interface as controlling a given layout property (eg: margin) for a given screen size.Controls the %1$s property for %2$s viewports.'=>'Керує властивістю %1$s для %2$s видових екранів.','The media file has been replaced'=>'Медіафайл було замінено','Currently selected'=>'Наразі вибрано','Search or type URL'=>'Знайдіть або введіть URL-адресу','Press ENTER to add this link'=>'Натисніть ENTER, щоб додати це посилання','Currently selected link settings'=>'Поточні вибрані налаштування посилання','Select a variation to start with:'=>'Виберіть варіацію для початку:','Choose variation'=>'Виберіть варіант','Generic label for block inserter buttonAdd block'=>'Додати блок','directly add the only allowed blockAdd %s'=>'Додати %s','%s block added'=>'додано блок %s','Multiple selected blocks'=>'Кілька вибраних блоків','You are currently in edit mode. To return to the navigation mode, press Escape.'=>'Ви перебуваєте в режимі редагування. Щоб повернутися до режиму навігації, натисніть клавішу Escape.','Midnight'=>'Опівночі','Electric grass'=>'Електрична трава','Pale ocean'=>'Блідий океан','Luminous dusk'=>'Сяючі сутінки','Blush bordeaux'=>'Рум\'яна бордо','Blush light purple'=>'Рум\'яна світло-фіолетові','Cool to warm spectrum'=>'Спектр від холодного до теплого','Very light gray to cyan bluish gray'=>'Від світло-сірого до блакитно-сірого з синюватим відтінком','Luminous vivid orange to vivid red'=>'Яскравий від яскраво-помаранчевого до яскраво-червоного','Luminous vivid amber to luminous vivid orange'=>'Від яскраво-яскравого бурштинового до яскраво-яскравого помаранчевого','Light green cyan to vivid green cyan'=>'Світло-зелений блакитний до яскраво-зеленого блакитного','Vivid cyan blue to vivid purple'=>'Яскравий блакитний до яскраво-фіолетового','Block breadcrumb'=>'Блокований хлібний м\'якуш','Move right'=>'Направо','Move left'=>'Ліворуч','Fill'=>'Заповнюй','Border radius'=>'Радіус кордону','Separate multiple classes with spaces.'=>'Відокремлюйте декілька класів пробілами.','Learn more about anchors'=>'Дізнайтеся більше про якорі','Enter a word or two — without spaces — to make a unique web address just for this block, called an “anchor”. Then, you’ll be able to link directly to this section of your page.'=>'Введіть одне-два 